import React from 'react';
import { useForm } from 'react-hook-form';
import { useNavigate } from 'react-router-dom';
import { X } from 'lucide-react';

const AdvertisementForm = ({ onSubmit }) => {
  const { register, handleSubmit, formState: { errors } } = useForm();
  const navigate = useNavigate();

  return (
    <form onSubmit={handleSubmit(onSubmit)} className="space-y-6 p-6 bg-white shadow-md rounded-lg relative">
      {/* Close Button */}
      <button
        onClick={() => navigate('/')}
        type="button"
        className="absolute top-4 right-4 p-2 rounded-full hover:bg-gray-200 transition-colors"
        aria-label="Close Form"
      >
        <X size={24} className="text-gray-600" />
      </button>

      {/* Title Input */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Title</label>
        <input
          type="text"
          className={`mt-1 p-2 w-full border ${errors.title ? 'border-red-500' : 'border-gray-300'} rounded-md focus:ring-2 focus:ring-blue-500`}
          placeholder="Enter a title for the advertisement"
          {...register('title', { required: 'Title is required' })}
        />
        {errors.title && <p className="text-red-500 text-sm mt-1">{errors.title.message}</p>}
      </div>

      {/* Content Textarea */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Content</label>
        <textarea
          className={`mt-1 p-2 w-full border ${errors.content ? 'border-red-500' : 'border-gray-300'} rounded-md focus:ring-2 focus:ring-blue-500`}
          rows="4"
          placeholder="Write the content of the advertisement"
          {...register('content', { required: 'Content is required' })}
        />
        {errors.content && <p className="text-red-500 text-sm mt-1">{errors.content.message}</p>}
      </div>

      {/* Start Date */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Start Date</label>
        <input
          type="date"
          className="mt-1 p-2 w-full border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500"
          {...register('start_date')}
        />
      </div>

      {/* End Date */}
      <div>
        <label className="block text-sm font-medium text-gray-700">End Date</label>
        <input
          type="date"
          className="mt-1 p-2 w-full border border-gray-300 rounded-md focus:ring-2 focus:ring-blue-500"
          {...register('end_date')}
        />
      </div>

      {/* Budget Input */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Budget</label>
        <input
          type="number"
          className={`mt-1 p-2 w-full border ${errors.budget ? 'border-red-500' : 'border-gray-300'} rounded-md focus:ring-2 focus:ring-blue-500`}
          placeholder="Enter the budget for the advertisement"
          {...register('budget', { required: 'Budget is required', min: { value: 0, message: 'Budget must be a positive number' } })}
        />
        {errors.budget && <p className="text-red-500 text-sm mt-1">{errors.budget.message}</p>}
      </div>

      {/* Status Select */}
      <div>
        <label className="block text-sm font-medium text-gray-700">Status</label>
        <select
          className={`mt-1 p-2 w-full border ${errors.status ? 'border-red-500' : 'border-gray-300'} rounded-md focus:ring-2 focus:ring-blue-500`}
          {...register('status', { required: 'Status is required' })}
        >
          <option value="">Select a status</option>
          <option value="pending">Pending</option>
          <option value="active">Active</option>
          <option value="completed">Completed</option>
        </select>
        {errors.status && <p className="text-red-500 text-sm mt-1">{errors.status.message}</p>}
      </div>

      {/* Submit Button */}
      <div>
        <button
          type="submit"
          className="w-full py-2 px-4 bg-blue-600 text-white font-bold rounded-md hover:bg-blue-700 transition-colors"
        >
          Submit
        </button>
      </div>
    </form>
  );
};

export default AdvertisementForm;
